@Despertar del SER Yo haré lo que estime oportuno, y usted no es nadie para decirme lo que yo tengo que hacer.
No he juzgado, pero ahora lo haré... Es una estafa, una perdida de tiempo y tomadura de pelo que nos tengan escuchando una hora lo mismo, matando la perdiz. Nos merecemos un respeto.
Para que Youtube te pague no todo vale.

